INSERT INTO `commands` (`id`,`name`,`keyword`,`url`,`description`,`kind`,`origin`,`created_at`,`modified_at`,`bookmarklet`,`user_id`,`public`,`public_queries`) VALUES ('41','Whois Lookup','whois','http://www.networksolutions.com/whois/results.jsp?domain=(q)','WHOIS is a TCP-based query/response protocol which is widely used for querying a database in order to determine the owner of a domain name, an IP address, or an autonomous system number on the Internet. WHOIS lookups were traditionally made using a command line interface, but a number of simplified web-based tools now exist for looking up domain ownership details from different databases. Web-based WHOIS clients still rely on the WHOIS protocol to connect to a WHOIS server and do lookups, and command-line WHOIS clients are still quite widely used by system administrators.','parametric','import','2007-07-12 11:20:13',NULL,'0','7','1','1');
